import React from 'react';
import { Link } from 'react-router-dom';
import "../../../styles/styles.scss"

const RestaurantCategories = (props) => {
  return (
    <div className="contain-vertical">
      <h2 className="title">Burgers</h2>
      <div className="container-horizontal">
        <FoodProduct />
        <FoodProduct />
      </div>
    </div>
  )
}

const FoodProduct = (props) => {
  return (
    <div className="container-horizontal card"
      style={{ flex: 1, backgroundColor: '#808080' }}>
      <div style={{ flex: 1 }}>
        <h3 className="title normal-text">Spicy Chicken Sandwich</h3>
        <p className="subtitle">A boneless breast of chicken seasoned with a spicy blend of peppers, freshly breaded, pressure cooked in 100% refined peanut oil and served on a toasted, buttered bun with dill pickle chips. Also available on a multigrain bun.</p>
      </div>
      <img
        src="https://cn-geo1.uber.com/image-proc/resize/eats/format=webp/width=550/height=440/quality=70/srcb64=aHR0cHM6Ly9kMXJhbHNvZ25qbmczNy5jbG91ZGZyb250Lm5ldC9kODA5OGIxMC00ODEzLTQ0ODctOTNlZC1kODg0MDAwMDBkNmMuanBlZw=="
        style={{ aspectRatio: '1/1', height: '100px' }}
      />
    </div>
  )
}

export default RestaurantCategories;
